import React from 'react';
import {Link} from 'react-router-dom';
import { Form, Input } from '@rocketseat/unform';
import { 
  Container,
  Imagem,
  DivInput,
  LogoImg,
  Title,
  TextInput,
  InputEmail,
  ButtonDiv,
  ButtonSignIn,
  ButtonLinkDiv
 } from './styles';

 import logo from '../../assets/Image/Logo.png';
 import img1 from '../../assets/Image/image.png';

export default function signIn() {
  return (
    <Container>
      <DivInput>
        <LogoImg src={logo} />

        <Title>Sign In</Title>
        <Form>
          <TextInput>Email: </TextInput>
          <Input placeholder="Insira seu Email" type="email"/>

          <TextInput>Senha: </TextInput>
          <Input placeholder="Insira sua Senha" type="password"/>
        </Form>
        <ButtonDiv>
          <ButtonSignIn>
              Entrar
          </ButtonSignIn>
        </ButtonDiv>
        <ButtonLinkDiv>
          <Link to={"/signup"}>Inscrever-se</Link>
        </ButtonLinkDiv>
      </DivInput>
      <Imagem src={img1} />
    </Container>
  );
}
